import React from 'react';
import { createStackNavigator } from "@react-navigation/stack";
import {LibariesScreen, DetailStoryScreen} from '../ScreemFolder/StoryScreen';

const LibaryStack = createStackNavigator();
const LibaryStackScreen = ({ navigation }) => (
  <LibaryStack.Navigator mode="modal">
    <LibaryStack.Screen 
      name="libary"
      component={LibariesScreen} 
      options = {{
        title: 'Libary',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
      }}
    />
    <LibaryStack.Screen
      name="DetailStory"
      component={DetailStoryScreen} 
      options = {{
        title: 'Libary',
            headerStyle: {
              backgroundColor: '#8a2be2',
            },
            headerTintColor: '#fff',
      }}
    />
  </LibaryStack.Navigator>
)
export {LibaryStackScreen};
